import React from "react";
import "./css/style.css";

class ContactPage extends React.Component {
  // constructor(props) {
  //   super(props);
  // }

  render() {
    return (
      <div className="uk-position-center">
        <article className="uk-article uk-width-2-3@s uk-width-2-3@m uk-row-first uk-align-center uk-margin-large-bottom">
          <div className="uk-width-1-1 uk-row-first uk-margin-large-bottom">
            <p className=" uk-heading-small">Contact</p>
          </div>

          <p className="uk-text-justify">
            If you have any queries or questions why not get in contact? I am
            currently accepting commissions and freelance work
          </p>

          <p className="uk-text-justify">
            <i>danielrdhr@gmail.com</i>
          </p>

          <p className="uk-article-meta uk-text-capitalize  uk-text-small uk-width-2-3@s" />
        </article>
      </div>
    );
  }
} //END OF CLASS

export default ContactPage;
